import '../src/style.css';

function App() {
  return (

    <div classname="App">
      <User name="Nemesio" age={29} email="dominicananemesio@gmail.com" />
      <User name="Maria" age={32} email="maria@gmail.com" />
      <User name="alma" age={47} email="QueenAlma@gmail.com" />
    </div>

  );
};

const User = (props) => {
  return (
    <div>
      <h1>{props.name}</h1>
      <h1>{props.age}</h1>
      <h1>{props.email}</h1>
    </div>
  );
};




export default App;
